import React from "react"
import { BrowserRouter as Router, Switch, Link } from 'react-router-dom';
import Forms from "./forms"

function App(){

  const go = function(){
    return(
      <Router>
      <Switch>
        <Link to="/forms" component={Forms}/>
      </Switch>
    </Router>
    )
  }
  return(
    <div>
    <p>Hi</p>
    <button onClick={go}>A</button>
    </div>
  )
}

export default App
